INSERT INTO `projects` VALUES (1,'a-4','A4 - Perforce Codeline Automation',1,'Automation for managing Perforce codelines, based on a library of reusable Perl modules. Each codeline (branch) can have its own automated submit regression and shared default view.',164,164,2,2,3,1),(2,'a-a-p','A-A-P',1,'A-A-P helps you with distributed development of software. Install a program on your system, obtain the sources and make modifications, manage multiple versions of the same project, distribute packages and much more. A-A-P runs on many operating systems.',165,165,2,2,4,38),(3,'a-accessvnm','A-Access for Vietnamese users',1,'We initiate an accounting software for Vietnamese that enables small enterprises, small user groups to get easier access to accounting that is modular based, easy to customize, open source and fast running, requires minimum installation based on MSAccess',166,166,NULL,NULL,NULL,NULL),(4,'a-ads-xml','ads-xml',1,'ads-xml is the repository of the adms library of the UCM interface - the public interface of the Agilent RF analog simulator ADS. &lt;br/&gt;Guidelines on how to use the UCM interface are provided. &lt;br/&gt;The adms xml scripts can be downloaded from t',167,167,3,2,NULL,10),(5,'a-aio','Aabye All-In-One',1,'A module based CMS like system for hosting multiple internet projects written in PHP and using MySQL. Modules will also include database, CRM and time management solutions.',168,168,2,NULL,5,NULL),(6,'a-blog','A-Blog',1,'Simple Blogging System using PHP and MySQL technologies.  Post new blog entries, with ratings and comments.  Customise the site to meet your own needs and alter stylesheet to achieve your own look and feel.',169,169,NULL,NULL,NULL,NULL),(7,'a-bot','aBot',1,'ABot is a simple bot program for ADC networks written in Java that can connect to a hub and provide facilities for the users and operators, like release notice, anti-spam filter, security, radio, text messages and more.',170,170,54,1,6,10),(8,'a-chat','a-chat web client/server',2,'A-chat is a platform agnostic Java applet GUI client (&lt; 8KB) and python server.  Features include: multiple named users and chats, Force a URL into a browser window, Timed connections, A current users column, optional error/operatonal/message logging.',171,171,NULL,NULL,NULL,NULL),(9,'a-client',NULL,2,'An Alternative IRC Client For Windows.\r\nOther OS Versions Of The Client May Be Released In The Future.\r\nmIRC Style, But With It&#039;s Own Style.',172,172,2,1,2,5),(10,'a-community','A-Community',1,NULL,173,173,2,1,35,2),(11,'a-conman','a ConMan - Automated Content Management',4,'a-ConMan is a flexible database solution built to categorize and manage your image and video content. Giving you the ability to automate the building and updating for any type of content specific website within seconds. Utilizing one of the most advanced',174,174,NULL,NULL,NULL,NULL),(12,'a-dict','a-dict',1,'Dictionary, like babylon',47,175,NULL,NULL,NULL,NULL),(13,'a-erp','A-ERP',1,'A-ERP is a plug-in based framework for building business applications.',175,176,NULL,11,8,38),(14,'a-f','af framework',1,'a-f is a PHP Framework that inspired by azpiration (avm) designed by Harry S Kartono, and using the modified IWF Library.',176,177,3,2,5,10),(15,'a-fun-qt-demo',NULL,NULL,NULL,177,178,NULL,NULL,NULL,NULL),(16,'a-gen','A-Gen',1,'With A-Gen, one can create static Web photo albums directly from a directory of pictures. Since the album is static HTML, a Web server is not needed to view the album from a local medium. The albums created by A-Gen should be easy to use.',178,179,NULL,NULL,NULL,NULL),(17,'a-gt-storage',NULL,1,'GT P2P Distributed Storage application is built on top of the GreenTea P2P Distributed Network Computing Platform (free download at www.GreenTeaTech.com). The goal is to build a P2P distributed storage application that is able to seamlessly share storage',179,180,2,1,6,10),(18,'a-helper','Archmage Helper',1,'Archmage Helper is an example set of simple scripts to p